import React, { useState } from "react";
import characterImg from "./character.png";
import monsterImg from "./monster.jpeg";   // use .jpeg if that's the file
import swordImg from "./sword.jpg";        // use .jpg if that's the file
import ladderImg from "./ladder.png";
import spaceBg from "./space.avif";

const storyNodes = {
  start: {
    text: "You enter a maze. Do you want to go left or right?",
    images: ["character"],
    options: [
      { text: "Left", next: "leftBridge", move: "left" },
      { text: "Right", next: "ladderNode", move: "right" }
    ],
  },
  leftBridge: {
    text: "You see a rickety bridge. Do you want to cross it?",
    images: ["character"],
    options: [
      { text: "Yes", next: "bridgeFall", move: "center" },
      { text: "No", next: "hiddenPath", move: "left" }
    ],
  },
  bridgeFall: {
    text: "While you cross, the bridge snaps! You fall. Game over ðŸ’€",
    images: ["character"],
    options: [{ text: "Restart", next: "start", move: "start" }]
  },
  hiddenPath: {
    text: "Smart move. You find a hidden path and a shiny sword. Do you pick it up?",
    images: ["character", "sword"],
    options: [
      { text: "Yes", next: "monsterFight", move: "left" },
      { text: "No", next: "monsterLose", move: "left" }
    ],
  },
  monsterFight: {
    text: "A monster appears! Do you swing your sword?",
    images: ["character", "monster"],
    options: [
      { text: "Yes", next: "swingSword", move: "center" },
      { text: "No", next: "lose", move: "center" }
    ],
  },
  swingSword: {
    text: "You swing your sword at the monster!",
    images: ["character", "monster", "sword"],
    swordSwing: true,
    options: [{ text: "Continue", next: "win", move: "center" }]
  },
  monsterLose: {
    text: "A monster attacks! You have no weapon. Game over ðŸ˜ˆ",
    images: ["monster"],
    options: [{ text: "Restart", next: "start", move: "start" }]
  },
  win: {
    text: "You slay the monster and find a treasure chest. You win! ðŸ†",
    images: ["character"],
    options: [{ text: "Restart", next: "start", move: "start" }]
  },
  lose: {
    text: "The monster attacks and you lose! Game over.",
    images: ["monster"],
    options: [{ text: "Restart", next: "start", move: "start" }]
  },
  ladderNode: {
    text: "You see a ladder. Do you want to climb up?",
    images: ["character", "ladder"],
    options: [
      { text: "Yes", next: "climbLadder", move: "up" },
      { text: "No", next: "deadEnd", move: "right" }
    ]
  },
  climbLadder: {
    text: "You climb up the ladder and escape the maze! You win! ðŸŽ‰",
    images: ["character", "ladder"],
    climb: true,
    options: [{ text: "Restart", next: "start", move: "start" }]
  },
  deadEnd: {
    text: "You find a dead end. Game over.",
    images: [],
    options: [{ text: "Restart", next: "start", move: "start" }]
  }
};

export default function MazeGame() {
  const [node, setNode] = useState("start");
  const [position, setPosition] = useState("start");

  const handleOption = (opt) => {
    setNode(opt.next);
    setPosition(opt.move || position);
  };

  // CSS classes for movement
  const getCharacterClass = () => {
    if (storyNodes[node].climb) return "character-up";
    switch (position) {
      case "left":
        return "character-left";
      case "right":
        return "character-right";
      case "up":
        return "character-up";
      default:
        return "character-center";
    }
  };

  return (
    <div className="game-container">
      <h1 className="game-title">Maze Adventure Game</h1>
      <div className="maze-area">
        {/* Character */}
        {storyNodes[node].images?.includes("character") && (
          <img src={characterImg} alt="Character" className={`character ${getCharacterClass()}`} />
        )}
        {/* Monster */}
        {storyNodes[node].images?.includes("monster") && (
          <img src={monsterImg} alt="Monster" className="monster" />
        )}
        {/* Ladder */}
        {storyNodes[node].images?.includes("ladder") && (
          <img src={ladderImg} alt="Ladder" className="ladder" />
        )}
        {/* Sword swing animation */}
        {storyNodes[node].swordSwing && (
          <img src={swordImg} alt="Sword" className="sword-swing" />
        )}
        {/* Sword */}
        {storyNodes[node].images?.includes("sword") && !storyNodes[node].swordSwing && (
          <img src={swordImg} alt="Sword" className="sword" />
        )}
      </div>
      <div className="story">{storyNodes[node].text}</div>
      <div className="choices">
        {storyNodes[node].options.map((opt, idx) => (
          <button key={idx} onClick={() => handleOption(opt)}>
            {opt.text}
          </button>
        ))}
      </div>
    </div>
  );
}
